import React from "react";
import Project1 from "./Images/BallsToTheWall.webp";
import Project2 from "./Images/Roadblock.webp";

const Work = () =>{
  return(
    <div id="Projects">
      <div>
        <img src={Project1} alt="Balls To The Wall Poster"/>
      </div>

    </div>
  );
}

export default Work;
